class Contact(object):    def __init__(self, username: str, age: int, address):        self.username = username        self.age = age        self.address = address    def get_all(self):        return f"Username: {self.username}\nAge: {self.age}\nAddress: {self.address}"    def set_username(self, user_name):        self.username = user_name_contact = Contact("mbr-sagor", 25, "Dhaka, Bangladesh")print(_contact.get_all())_contact.set_username("Sagor")print(_contact.username)